import React from "react";
import TextField from "@material-ui/core/TextField";
import Grid from "@material-ui/core/Grid";
import "./App.css";
import Movie from "./movies/index";

function App() {
  return (
    <div>
      <header className="App-header">
        <Movie />
      </header>
      <Grid container spacing={4}>
        <Grid item xs={4}>
          <TextField
            type="text"
            id="outlined-basic"
            label="Search"
            variant="outlined"
          />
        </Grid>
      </Grid>
    </div>
  );
}

export default App;
